import { useState, useEffect } from "react";
import UserIcon from "@heroicons/react/outline/UserIcon";

function Login() {
  const [formData, setFormData] = useState({
    email: "",
    password: "",
  });
  const { email, password } = formData;

  //   useEffect(() => {});
  const onChange = (e) => {
    setFormData((prevState) => ({
      ...prevState,
      [e.target.name]: e.target.value,
    }));
  };
  const onSubmit = (e) => {
    e.preventDefault();
  };
  return (
    <div className=" h-screen">
      <section className="bg-third flex flex-col items-center text-black mb-2 rounded-b-lg py-2">
        <div className="h-10 w-10">
          <UserIcon />
        </div>
        <h1 className=" font-bold">Login</h1>
      </section>
      <section className="flex flex-col p-4 h-full">
        <form action="POST" onSubmit={onSubmit} className="flex flex-col">
          <div>
            <div className="flex">
              <input
                type="email"
                id="email"
                name="email"
                value={email}
                placeholder="Email..."
                onChange={onChange}
                className="flex-grow  rounded-lg p-2 mb-2 bg-secondary"
              />
            </div>
            <div className="flex">
              <input
                type="password"
                id="password"
                name="password"
                value={password}
                placeholder="Password..."
                onChange={onChange}
                className=" rounded-lg p-2 mb-2 bg-secondary flex-grow"
              />
            </div>
          </div>
          <div className="self-basline">
            <button
              type="submit"
              className="bg-third text-black w-full p-3 font-bold text-xl rounded-lg mt-2"
            >
              Login
            </button>
            <div className="text-center mt-2 text-gray-600">
              Already have an account?
            </div>
          </div>
        </form>
      </section>
    </div>
  );
}

export default Login;
